    {ntt"total": 2,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T01:08:11.459306",nt"name": "system-engineering-software-assessment-model-for-exploration-sesame-project",nt"isopen":
    true,nt"url": null,nt"notes": "Concept phase space-systems architecture
    evaluations typically use mass estimates as the primary means of ranking potential
    mission architectures. Software does not directly have physical mass and, as a result,
    is often left-out of such evaluations, despite the potential of being one of the
    main contributors to a mission's overall cost and risk. During NASA's Concept Exploration
    and Refinement (CE&amp;R) program, personnel from MIT, Draper Laboratories, and
    Payload Systems Inc. developed a systems architecture software assessment approach
    that addresses both the early concept phases of a program and the complexities of
    critical embedded software systems. This approach uses a series of weighted software
    and human-computer interaction parameters that evaluate how a system's architecture
    affects software. Payload Systems Inc. proposes to validate this Systems Engineering
    Software Assessment Model for Exploration as the next step on the path to a tool
    that provides early, reliable ranking of systems architectures based on software.
    rnThe Phase I effort will focus on validation of this assessment tool. This validation
    will be based on embedded spaceflight systems projects. Once validated, this assessment
    approach will provide a basis, during Phase II, for the development of a Systems
    Engineering tool for assessing the impact candidate system architectures on software.rn",nt"license_title":
